                steppedLine: 'before',
            },{
                label: 'systemsEvents',
                borderColor: window.chartColors.blue,
                data: systemsEvents,
                fill: false,
                steppedLine: 'before',
            },{
                label: 'systemState',
                borderColor: window.chartColors.yellow,
                data: systemState,
                fill: false,
                steppedLine: 'before',
            }]
        },
        options: {
            scales: {
                xAxes: [{
                    type: 'linear',
                    position: 'bottom'
                }]
            },
            elements: {
                line: {
                    tension: 0 // disables bezier curves
                }
            }
        },
    };

    window.onload = function() {
        var ctx = document.getElementById('canvas').getContext('2d');
        window.myBar = new Chart(ctx, config);

    };
</script>
</body>
</html>
